import React, { useEffect, useState } from "react";

function ContentRowTotales(props) {

    const [books, setBooks] = useState('');
    const [categories, setCategories] = useState('');
    const [users, setUsers] = useState('');

    useEffect(() => {
        fetch('http://localhost:3030/API/books/')
            .then(res => res.json())
            .then(data => setBooks(data.data.count))
            .catch(e => console.log(e))
    }, [])

    useEffect(() => {
        fetch('http://localhost:3030/API/users/list')
            .then(res => res.json())
            .then(data => setUsers(data.data.count))
            .catch(e => console.log(e))
    }, [])

    //  useEffect(() => {
    //  fetch('http://localhost:3001/api/users/list')
    //  .then(res => res.json())
    //  .then(data => setUsers(data.data.count))
    //   .catch(e => console.log(e))
    //  }, [])

    return (
        <React.Fragment>
            <div className="contentTotals">
                <div className="cardbody">
                    <span>Total de libros: {books}</span>
                </div>
                <div className="cardbody">
                    <span>Total de usuarios: {users}</span>
                </div>

            </div>
        </React.Fragment>
    );
}


export default ContentRowTotales;
